      <input
        type="search"
        required
        className="input"
        value={searchValue}
        onChange={(e) => setSearchValue(e.target.value)}
      />
      <i className="fa fa-search" />
      {/* <a href="javascript:void(0)" onClick={clearInput} className={styles.clearBtn}>
        Clear
